import './HomePage.scss'

export default function HomePage() {
    return (
        <main className="home-page">
            <h1 className="home-page__title">Welcome!</h1>
            <label htmlFor="" className="home-page__user"></label>
            <input type="text" className="home-page__user-input" placeholder='Username' />
            <label htmlFor="" className="home-page__password"></label>
            <input type="text" className="home-page__password-input" />
            <button className="home-page__button">Login</button>
        </main>
    )
}
